import { Grid, makeStyles, Paper, Card, CardContent, Typography, Divider } from "@material-ui/core";

const useStyles = makeStyles((theme: any) => ({
    root: {
        display: "flex",
        backgroundColor: "#792141",
        width: "100%",
        padding: "10px",
        textTransform: 'uppercase',
        borderRadius: '10px'
    },
    card: {
        maxWidth: 400,
        margin: "auto",
        height: '120px',
        transition: "0.3s",
        backgroundColor: "#792141",
        boxShadow: "none",
        // "&:hover": {
        //     boxShadow: "0 16px 70px -12.125px rgba(0,0,0,0.3)"
        // }
    },
    content: {
        textAlign: "left",
        padding: 10,
        color: 'white'
    },
    rootContainer: {
        display: "flex",
        width: "100%",
        padding: "10px 0px 17px 0px",
        background: '#f1f5f8',
        marginBottom: 10
    },
    cardpadding: {
        padding: '0 30px 0 0',
        '&:last-child': {
            padding: '0 30px 0 0',
        }
    }
}));
export const Category = (props: any) => {
    const classes = useStyles();
    return (
        <Grid item container direction="row" justify="space-between" className={classes.rootContainer}>
            <Grid item xs className={classes.cardpadding}>
                <Grid item xs={12} className={classes.root}>
                    <Card className={classes.card}>
                        <CardContent className={classes.content}>

                        </CardContent>
                    </Card>
                </Grid>
            </Grid>
        </Grid>
    )
}
